import React, { memo } from 'react';
import { 
  TrendingUp, 
  TrendingDown, 
  DollarSign, 
  Target, 
  Tag, 
  Eye,
  ArrowRight,
  Sparkles,
  Star,
  Zap,
  Award,
  Shield,
  Activity
} from 'lucide-react';

const StockDataTable = memo(({ fundSummaries, onFundClick }) => {
  const formatCurrency = (amount) => {
    return new Intl.NumberFormat('en-IN', {
      style: 'currency',
      currency: 'INR',
      minimumFractionDigits: 2,
    }).format(amount || 0);
  };

  const formatPercentage = (value) => {
    if (value == null || isNaN(value)) {
      return 'N/A';
    }
    return `${value.toFixed(2)}%`;
  };

  const getProfitLossColor = (value) => {
    if (value > 0) return 'text-green-600';
    if (value < 0) return 'text-red-600';
    return 'text-gray-600';
  };

  const getProfitLossBgColor = (value) => {
    if (value > 0) return 'bg-gradient-to-r from-green-50 to-emerald-50';
    if (value < 0) return 'bg-gradient-to-r from-red-50 to-rose-50';
    return 'bg-gradient-to-r from-gray-50 to-slate-50';
  };

  const getProfitLossIcon = (value) => {
    if (value > 0) return TrendingUp;
    if (value < 0) return TrendingDown;
    return Activity;
  };

  const getFundIcon = (fund) => {
    if (fund.isEmergency) return Shield;
    if (fund.profitLossPercent > 10) return Star;
    if (fund.profitLossPercent > 0) return Award;
    return Target;
  };

  if (!fundSummaries || fundSummaries.length === 0) {
    return (
      <div className="text-center py-16">
        <div className="relative mb-8">
          <div className="w-24 h-24 mx-auto bg-gradient-to-r from-gray-100 to-gray-200 rounded-full flex items-center justify-center shadow-lg">
            <Target className="w-12 h-12 text-gray-400" />
          </div>
          <div className="absolute -top-2 -right-2 animate-bounce">
            <Sparkles className="w-6 h-6 text-yellow-400" />
          </div>
        </div>
        <h3 className="text-2xl font-bold text-gray-900 mb-4">No Investments Found</h3>
        <p className="text-lg text-gray-600 mb-8 max-w-md mx-auto leading-relaxed">
          Start building your portfolio by searching for mutual funds above
        </p>
        <div className="inline-flex items-center px-6 py-3 bg-gradient-to-r from-blue-100 to-purple-100 text-blue-800 rounded-2xl shadow-lg">
          <Zap className="w-5 h-5 mr-2" />
          <span className="font-semibold">Ready to invest?</span>
        </div>
      </div>
    );
  }

  return (
    <div className="space-y-6">
      {/* Header */}
      <div className="bg-gradient-to-r from-blue-600 via-purple-600 to-indigo-600 rounded-2xl p-6 text-white relative overflow-hidden">
        <div className="absolute inset-0 bg-gradient-to-r from-blue-400/20 to-purple-400/20"></div>
        <div className="relative z-10">
          <div className="flex items-center justify-between">
            <div>
              <h3 className="text-2xl font-bold mb-2">Your Investment Portfolio</h3>
              <p className="text-blue-100">Click on any fund to view detailed information</p>
            </div>
            <div className="flex items-center space-x-3">
              <div className="p-3 bg-white bg-opacity-20 rounded-xl backdrop-blur-sm">
                <Activity className="w-6 h-6" />
              </div>
              <div className="p-3 bg-white bg-opacity-20 rounded-xl backdrop-blur-sm">
                <Star className="w-6 h-6" />
              </div>
            </div>
          </div>
        </div>
      </div>

      {/* Fund Cards Grid */}
      <div className="grid grid-cols-1 lg:grid-cols-2 xl:grid-cols-3 gap-6">
        {fundSummaries.map((fund, index) => {
          const FundIcon = getFundIcon(fund);
          const ProfitLossIcon = getProfitLossIcon(fund.profitLoss);
          const isProfit = fund.profitLoss > 0;

          return (
            <div
              key={fund.fundId || fund.schemeCode}
              className="bg-white rounded-2xl shadow-lg hover:shadow-2xl transition-all duration-500 hover:scale-105 cursor-pointer group relative overflow-hidden border border-gray-200"
              onClick={() => onFundClick(fund)}
              style={{ animationDelay: `${index * 100}ms` }}
            >
              {/* Background Pattern */}
              <div className="absolute inset-0 opacity-5">
                <div className="absolute top-0 right-0 w-20 h-20 bg-gradient-to-br from-blue-400 to-purple-400 rounded-full -translate-y-10 translate-x-10"></div>
                <div className="absolute bottom-0 left-0 w-16 h-16 bg-gradient-to-br from-green-400 to-emerald-400 rounded-full translate-y-8 -translate-x-8"></div>
              </div>

              <div className="relative z-10 p-6">
                {/* Header */}
                <div className="flex items-start justify-between mb-6">
                  <div className="flex items-center space-x-4">
                    <div className={`p-3 rounded-2xl ${isProfit ? 'bg-gradient-to-br from-green-500 to-emerald-500' : 'bg-gradient-to-br from-red-500 to-rose-500'} group-hover:scale-110 transition-transform duration-300 shadow-lg`}>
                      <FundIcon className="w-6 h-6 text-white" />
                    </div>
                    <div>
                      <h4 className="text-lg font-bold text-gray-900 group-hover:text-blue-600 transition-colors duration-300 line-clamp-2">
                        {fund.name || fund.schemeName}
                      </h4>
                      {fund.isEmergency && (
                        <div className="flex items-center mt-2">
                          <Shield className="w-4 h-4 text-red-500 mr-1" />
                          <span className="text-xs font-semibold text-red-600 bg-red-50 px-2 py-1 rounded-full">
                            Emergency Fund
                          </span>
                        </div>
                      )}
                    </div>
                  </div>
                  <div className="flex items-center space-x-2">
                    <div className="p-2 bg-gray-100 rounded-lg group-hover:bg-blue-100 transition-colors duration-300">
                      <Eye className="w-4 h-4 text-gray-600 group-hover:text-blue-600" />
                    </div>
                    <ArrowRight className="w-4 h-4 text-gray-400 group-hover:text-blue-600 group-hover:translate-x-1 transition-all duration-300" />
                  </div>
                </div>

                {/* Tag */}
                {fund.tag && (
                  <div className="mb-6">
                    <div className="inline-flex items-center px-3 py-2 bg-gradient-to-r from-blue-100 to-purple-100 text-blue-800 rounded-xl shadow-sm">
                      <Tag className="w-4 h-4 mr-2" />
                      <span className="text-sm font-semibold">{fund.tag}</span>
                    </div>
                  </div>
                )}

                {/* Financial Data */}
                <div className="space-y-4">
                  {/* Invested Amount */}
                  <div className="flex items-center justify-between">
                    <div className="flex items-center space-x-2">
                      <DollarSign className="w-4 h-4 text-gray-500" />
                      <span className="text-sm font-medium text-gray-600">Invested</span>
                    </div>
                    <span className="text-lg font-bold text-gray-900">{formatCurrency(fund.totalInvested)}</span>
                  </div>

                  {/* Current Value */}
                  <div className="flex items-center justify-between">
                    <div className="flex items-center space-x-2">
                      <Target className="w-4 h-4 text-gray-500" />
                      <span className="text-sm font-medium text-gray-600">Current Value</span>
                    </div>
                    <span className="text-lg font-bold text-gray-900">{formatCurrency(fund.totalValue)}</span>
                  </div>

                  {/* Profit/Loss */}
                  <div className="flex items-center justify-between">
                    <div className="flex items-center space-x-2">
                      <ProfitLossIcon className="w-4 h-4 text-gray-500" />
                      <span className="text-sm font-medium text-gray-600">P&L</span>
                    </div>
                    <div className="text-right">
                      <div className={`text-lg font-bold ${getProfitLossColor(fund.profitLoss)}`}>
                        {formatCurrency(fund.profitLoss)}
                      </div>
                      <div className={`inline-flex items-center px-3 py-1 rounded-full text-sm font-semibold ${getProfitLossBgColor(fund.profitLossPercent)} ${getProfitLossColor(fund.profitLossPercent)}`}>
                        {formatPercentage(fund.profitLossPercent)}
                      </div>
                    </div>
                  </div>
                </div>

                {/* Performance Indicator */}
                <div className="mt-6 pt-4 border-t border-gray-100">
                  <div className="flex items-center justify-between">
                    <span className="text-sm text-gray-500">Performance</span>
                    <div className="flex items-center space-x-1">
                      {isProfit ? (
                        <>
                          <TrendingUp className="w-4 h-4 text-green-500" />
                          <span className="text-sm font-semibold text-green-600">Growing</span>
                        </>
                      ) : (
                        <>
                          <TrendingDown className="w-4 h-4 text-red-500" />
                          <span className="text-sm font-semibold text-red-600">Declining</span>
                        </>
                      )}
                    </div>
                  </div>
                </div>
              </div>
            </div>
          );
        })}
      </div>

      {/* Footer */}
      <div className="bg-gradient-to-r from-gray-50 to-blue-50 rounded-2xl p-6 text-center">
        <div className="flex items-center justify-center space-x-2 text-gray-600">
          <Eye className="w-5 h-5" />
          <span className="text-sm font-medium">Click on any fund card to view detailed information, transactions, and SIP details</span>
        </div>
      </div>
    </div>
  );
});

StockDataTable.displayName = 'StockDataTable';

export default StockDataTable;
